import React from 'react';
import {HashRouter as Router, Switch, Route,Link} from 'react-router-dom';
import Red from './Red.js';
import Blue from './Blue.js';

const App = () => {
    return(
        <Router>
            <nav>
                <Link to='/'><button>Red</button></Link>
                <Link to='/Other'><button>Blue</button></Link>
            </nav>
            <div >
                  <Switch>
                      <Route path='/' exact component={Red}/>
                      <Route path='/Other'exact component={Blue}/>
                  </Switch>
            </div>
        </Router>
    )
}

export default App;
